import React from "react";

class colaborador extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            nombre: null,
            apellido: null,
            correo: null,
            telefono: null,
            fechaNacimiento: null,
            supervisadoPor: null
        };
    }

    
}

export default colaborador;
